fun SigBoardInfo3.str(): String {
    return "SigBoardInfo3{\n" +
            "IdRcv=" + IdRcv +
            ",\n IdCon=" + IdCon +
            ",\n IdSwt=" + IdSwt +
            ",\n filters=" + filters.contentToString() +
            ",\n simpleFreq=" + simpleFreq.contentToString() +
            ",\n rangeBands=" + rangeBands.contentToString() +
            ",\n watchTimes=" + watchTimes.contentToString() +
            ",\n winParams=" + winParams.contentToString() +
            ",\n idk=" + idk.contentToString() +
            ",\n attenuator=" + attenuator.str() +
            ",\n allGroupRangeBands=" + allGroupRangeBands.contentToString() +
            ",\n a=" + a +
            ",\n minFreq=" + minFreq +
            ",\n maxFreq=" + maxFreq +
            '}';
}

@Override
fun AttenuatorSet.str(): String {
    return "AttenuatorSet{" +
            "bands=" + bands.joinToString(",") {
        with(it) {
            "band_t{" +
                    "id=" + id +
                    ", begfreq=" + begfreq +
                    ", endfreq=" + endfreq +
                    '}'
        }
    } +
            ", values=" + values.joinToString(",") {
        with(it) {
            "att_entry_t{" +
                    "band_id=" + band_id +
                    ", freq=" + freq
                    "}"
        }
    } +
            '}';
}

fun SignalMsg.str(): String = with (this) {
    "SignalMsg{\n" +
            "params=" + with(params) {
        "GenericSignalParams{\n" +
                "freq=" + freq +
                ",\n attenuator=" + attenuator +
                ",\n c=" + c +
                ",\n d=" + d +
                ",\n f=" + f +
                ",\n width=" + width +
                ",\n filter=" + filter +
                ",\n w=" + w +
                ",\n ae=" + ae +
                ",\n af=" + af +
                ",\n octets=" + octets.contentToString() +
                '}';
    } +
            ",\n a=" + a +
            ",\n b=" + b +
            ",\n c=" + c +
            ",\n d=" + d +
            ",\n dd=" + dd +
            ",\n ddd=" + ddd +
            "\nextedned=" + with(extended) {
        "SignalDataEx{" +
                "a=" + a.joinToString { it.str() } +
                ",\n b=" + b.joinToString { it.str() } +
                ",\n c=" + c.size +
                ", c=" + c.joinToString { it.str() } +
                with(power) {
                    "\nPowerPhase{" +
                            "a=" + Arrays.toString(a) +
                            ", b=" + Arrays.toString(b) +
                            ", c=" + c +
                            '}'
                } +
//                with(rep) {
//                    "\nSignalRep{" +
//                            "test=" + test +
//                            '}'
//                } +
                '}'
    } +
            "\n ${data.type()}"+
            '}'
}

fun iq.str(): String = with (this) {
    "iq{$i:$q}"
}

fun short_iq.str(): String = with (this) {
    "siq{$i:$q}"
}

